import React from 'react'
import dummyData from '../dummyData';

const TicketList = () => {

    const [tickets, setTickets] = useState(dummyData);

    return (
        <div>

      {tickets.map(ticket => {
        <Ticket key={ticket.id} ticket={ticket}/>
      })}

        </div>

    )
}

export default TicketList
